    [],nt"revision_timestamp": "2016-11-01T04:12:09.176953",nt"name": "enviroatlas-cleveland-oh-estimated-percent-green-space-along-walkable-roads",nt"isopen":
    false,nt"url": null,nt"notes": "This EnviroAtlas dataset estimates green
    space along walkable roads. Green space within 25 meters of the road centerline
    is included and the percentage is based on the total area between street intersections.
    In this community, green space is defined as Trees & Forest, Grass & Herbaceous,
    Woody Wetlands, and Emergent Wetlands. In this metric, water is also included in
    green space. Green space provides valuable benefits to neighborhood residents and
    walkers by providing shade, improved aesthetics, and outdoor gathering spaces. This
    dataset was produced by the US EPA to support research and online mapping activities
    related to EnviroAtlas. EnviroAtlas (https://www.epa.gov/enviroatlas) allows the
    user to interact with a web-based, easy-to-use, mapping application to view and
    analyze multiple ecosystem services for the contiguous United States. The dataset
    is available as downloadable data (https://edg.epa.gov/data/Public/ORD/EnviroAtlas)
    or as an EnviroAtlas map service. Additional descriptive information about each
    attribute in this dataset can be found in its associated EnviroAtlas Fact Sheet
    (https://www.epa.gov/enviroatlas/enviroatlas-fact-sheets).",nt"license_title":
